import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import MemeDetails from './MemeDetails'

const ReactRouterSetup = () => {
  return <Router>
      <Route path="/">
          <MemeDetails />
      </Route>
      <Route path="/memes">
          <MemeDetails />
      </Route>
  </Router>;
};

export default ReactRouterSetup;
